import React, { useEffect, useState } from 'react';
import { ContainerHeader, ContainerList } from './AppStyles';
import SearchBar from './components/SearchBar';
import Item from './components/Item';
import axios from 'axios';

const App = () => {

  const [lista, setLista] = useState(null);

  useEffect(() => {
    axios.get('https://ed87c2a9-bcc4-4e0c-8fd2-fefb9875b65b.mock.pstmn.io/getStockConsolidation')
      .then(res => {
        setLista(res.data.products);
    });
    console.log(lista);
  }, []);

  return (
    <div style={{ paddingLeft: 200, paddingRight: 200, paddingTop: 20, backgroundColor: '#DAE0E3' }}>
      <ContainerList>
        <ContainerHeader>
          <p>Fundos</p>
          <SearchBar
            value="Buscar"
            onchange={() => false}
          />
        </ContainerHeader>

        {lista.map(produto => 
          <Item
              titulo={produto.productName}
              saldoAtual="00,00"
              quant="3"
              precoMedio="00,00"
              ultimaCotacao="00,00"
              yield1M="0%"
              yield12M="0%"
              carteira="0%"
            />
          )}
      </ContainerList>
    </div>
  );
}

export default App;
